  },
  {
    img: '/static/market.jpg',
    msg: 'patrocina',
  },
  {
    img: '/static/drug.jpg',
    msg: 'beneficiate'
  }
];

const Cont = ({ img, msg }) => {

  return(
    <div className="main">
      <img src={img} alt=""/>
      <h1>{msg}</h1>
    </div>
